import Header from "./Header";

const layoutStyle = {
  border: "1px solid #DDD",
  borderRadius: "10px",
  maxWidth: "80%",
  vh: "80%",
  margin: "auto",
  padding: "3rem",
  fontSize: "2.5rem"
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
);

export default Layout;
